import React from "react";

function Header ({onLogout}) {
    return <header>
        <h1>SI Courses Feedback</h1>
        <button
                type="submit"
                className="btn btn-primary"
                onClick={onLogout}
              > Logout </button>
    </header>
}

export default Header;
